import React, { Component } from 'react';
import './ToDo.css';

class ToDo extends Component {
  render() {
    return (
    <div id="mainSection">
      <div className="taskCreate">
        <form className="task">
            <input type="text" id="input" name="taskDesc" placeholder="task description"></input>
            <button type="button" className="addB" >+</button>
        </form>
      </div>
    </div>
    );
  }
}

export default ToDo;
